import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import { Route, Router, Switch } from "react-router";
import Profile from "./Profile";
import Benefits from "./Benefits";
class ChoiceSection extends React.Component {
  render() {
    return (
      <section className="choice">
        <h1 className="choice__title">MagicTap</h1>
        <section className="choice__menu">
          <h2 className="choice__menu__title">Menu</h2>
          <Navbar collapseOnSelect expand="md">
            <Container>
              <Navbar.Collapse className="choice__menu__container">
                <Nav>
                  <Nav.Link href="/benefits" className="choice__menu__item">
                    Benefits
                  </Nav.Link>
                  <Nav.Link href="/profile" className="choice__menu__item">
                    My Profile
                  </Nav.Link>
                </Nav>
              </Navbar.Collapse>
            </Container>
          </Navbar>
          <Router>
            <Switch>
              <Route expand path="/" component={Benefits} />
              <Route expand path="/" component={Profile} />
            </Switch>
          </Router>
        </section>
      </section>
    );
  }
}

export default ChoiceSection;
